<!DOCTYPE html>
<html>
<head>
    <title>Loading</title>
    <style>
        @font-face {
            font-family: loading;
            src: url("KTEGAKI.ttf");
        }
        body{
            background-color: #c49d98; 
            font-family: loading;
        }
        #first{
            margin-top: 17.5em;
        }
        #load{
            color: white;
            font-size: 1.5em;
            text-align: center;
            margin-top: 15px;
        }
    </style>
    <script>
        function start(){
            var ouo=document.getElementById("load");
            var date = new Date(); 
            var s = date.getSeconds();
            if(s%4==0){
                ouo.innerHTML="Loading";
            }
            if(s%4==1){
                ouo.innerHTML="Loading."
            }
            if(s%4==2){
                ouo.innerHTML="Loading.."
            }
            if(s%4==3){
                ouo.innerHTML="Loading..."
            }
        }
        var t = window.setInterval("start()",1000);
        var t2= window.setTimeout("window.location='start_page.html'",5000); 
        window.addEventListener( "load", start, false );
    </script>
</head>
